这个错误是由 ESLint 规则 `no-import-assign` 引起的，该规则禁止对导入的模块进行赋值操作。在您的代码中，问题出现在以下行：

```javascript
window.PIXI = PIXI;
```

这行代码试图将导入的 PIXI 对象赋值给 `window.PIXI`，这违反了 ESLint 的规则。

要解决这个问题，您可以采取以下几种方法：

1. 移除赋值操作：
   如果您不需要将 PIXI 赋值给 window 对象，可以直接删除这行代码：

   ```javascript
   import * as PIXI from 'pixi.js';
   // 删除 window.PIXI = PIXI;
   ```

2. 使用 ESLint 注释禁用规则：
   如果您确实需要这个赋值操作，可以在该行添加 ESLint 注释来禁用这个规则：

   ```javascript
   import * as PIXI from 'pixi.js';
   // eslint-disable-next-line no-import-assign
   window.PIXI = PIXI;
   ```

3. 修改赋值方式：
   如果您需要在全局范围内使用 PIXI，可以考虑使用一个不同的变量名：

   ```javascript
   import * as PIXI from 'pixi.js';
   window.PixiJS = PIXI;
   ```

4. 在 ESLint 配置中禁用规则：
   如果您在项目中经常需要这样的操作，可以在 `.eslintrc` 文件中禁用这个规则：

   ```json
   {
     "rules": {
       "no-import-assign": "off"
     }
   }
   ```

建议采用第一种或第二种方法，因为它们不会影响全局的 ESLint 配置，并且能够保持代码的清晰性和一致性。

